import React from 'react';
import './component.button.css'

class Button extends React.Component{
    // handle = () => {
    //     this.props.onHandleClick();
    //     console.log('clicked!')
    // }
    render(){
        return(
            <div className="input">
                <button type={this.props.type} onClick={this.props.onClick()}>{this.props.type}</button>
            </div>
        );
    }
}

export default Button;
